---
<strong>rassq</strong> is a built-in function in `<code>C source code</code>'.</br>
</br>
(rassq <u>KEY</u> <u>LIST</u>)</br>
</br>
Return non-nil if <u>KEY</u> is `eq' to the cdr of an element of <u>LIST</u>.</br>
The value is actually the first element of <u>LIST</u> whose cdr is <u>KEY</u>.
